import React from "react";
import Songlibrary from './Songlibrary'
function Songcollection({songs}){
		
	

		return(
		
		
		<div class="libray">
		<h1>libray</h1>
		<div className="library_song">
		{
			songs.map((set) =>	<Songlibrary set={set} />
			
		)
			
		}
		</div>
		
		</div>
		
		
		
		
		)
		
		
		
	}



export default Songcollection
